import { configureStore } from '@reduxjs/toolkit';
import { combineReducers } from '@reduxjs/toolkit';
import { rootReducer } from './reducers';

export const initialState = {
  contacts: [],
  filter: '',
};

export const store = configureStore({ reducer: rootReducer });
